import React from 'react';
import './App.css';
import Pokecard from '../components/Pokecard/Pokecard';

function App() {
  return (
    <div className="App">
     <Pokecard id="001" name="Bulbasuar"/>
     <Pokecard id="002" name="Ivysaur" type=""/>
     <Pokecard id="003" name="Venusaur" type=""/>
     <Pokecard id="004" name="Charmander" type=""/>
     <Pokecard id="005" name="Charmeleon" type=""/>
     <Pokecard id="006" name="Charizard" type=""/>
     <Pokecard id="007" name="Squirtle" type=""/>
     <Pokecard id="008" name="Wartortle" type=""/>
     <Pokecard id="009" name="Blastoise" type=""/>
     <Pokecard id="010" name="Caterpie" type=""/>
     <Pokecard id="011" name="Metapod" type=""/>
    </div>
  );
}

export default App;
